import { useState } from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { Container } from '@mui/material';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Switch from '@mui/material/Switch';
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import LinearProgress from '@mui/material/LinearProgress';
import Breadcrumbs from '@mui/material/Breadcrumbs';
import Link from '@mui/material/Link';
import * as React from 'react';
import ListSubheader from '@mui/material/ListSubheader';
import List from '@mui/material/List';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Collapse from '@mui/material/Collapse';
import DraftsIcon from '@mui/icons-material/Drafts';
import ExpandLess from '@mui/icons-material/ExpandLess';
import ExpandMore from '@mui/icons-material/ExpandMore';
import Game from './component/component-Game';
import HoverRating from './component/component-Rating';


const label = { inputProps: { 'aria-label': 'Switch demo' } };

function BasicSwitches() {
  const [showDiv, setShowDiv] = useState(true);
  const handleToggle = (event) => { setShowDiv(event.target.checked) }
  return (
    <>
      <FormGroup>
        <FormControlLabel
          control={<Switch defaultChecked checked={showDiv} onChange={handleToggle} />}
          label="Show/Hide Div"
        />
      </FormGroup>
      {showDiv && (
        <div>La div s'affiche</div>
      )}
    </>
  );
}

function ImageAvatars() {
  return (
    <Stack direction="row" spacing={2}>
      <Avatar alt="Remy Sharp" src="data:image/jpeg;base64," />
      <Avatar alt="Travis Howard" src="data:image/jpeg;base64," />
      <Avatar alt="Cindy Baker" src="data:image/jpeg;base64," />
    </Stack>
  );
}

function BasicBreadcrumbs() {
  return (
    <div role="presentation">
      <Breadcrumbs aria-label="breadcrumb">
        <Link underline="hover" color="inherit" a href="https://www.google.com/?hl=fr">
          Google
        </Link>
        <Link underline="hover" color="inherit" a href="https://mui.com"
        >
          MUI
        </Link>
        <Link underline="hover" color="inherit" a href="https://mui.com/material-ui/react-breadcrumbs/"
        >
          Breadcrumbs
        </Link>
      </Breadcrumbs>
    </div>
  );
}

const fileTree = {
  label: "C:", children: [{ label: "Users", children: [{ label: "Keven", children: [{ label: "Desktop", children: [{ label: "GitKraken", children: [{label: "TicTacToe", children: [{label: "src"}]}] }]}]}]}]};

function FolderItem({ item, level = 0 }) {
  const [open, setOpen] = React.useState(false);
  const hasChildren = item.children && item.children.length > 0;

  return (
    <>
      <ListItemButton
        onClick={() => hasChildren && setOpen(!open)}
        sx={{ pl: 2 + level * 2 }}
      >
        <ListItemIcon>
          <DraftsIcon />
        </ListItemIcon>

        <ListItemText primary={item.label} />

        {hasChildren &&
          (open ? <ExpandLess /> : <ExpandMore />)}
      </ListItemButton>

      {hasChildren && (
        <Collapse in={open} timeout="auto" unmountOnExit>
          <List disablePadding>
            {item.children.map((child, index) => (
              <FolderItem
                key={index}
                item={child}
                level={level + 1}
              />
            ))}
          </List>
        </Collapse>
      )}
    </>
  );
}

function NestedList() {
  return (
    <List
      sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}
      subheader={
        <ListSubheader component="div">
          Files Path to TicTacToe.app
        </ListSubheader>
      }
    >
      <FolderItem item={fileTree} />
    </List>
  );
}

export default function AccordionUsage() {
  return (
    <Container>
      <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1-content"
          id="panel1-header"
        >
          <Typography component="span">Tic Tac Toe</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Game />
        </AccordionDetails>
      </Accordion>
      <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel2-content"
          id="panel2-header"
        >
          <Typography component="span">Autres MUI</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Stack spacing={2}>
            <HoverRating />
            <BasicSwitches />
            <ImageAvatars />
            <LinearProgress variant="determinate" value={50} />
            <BasicBreadcrumbs />
            <NestedList />
          </Stack>
        </AccordionDetails>
      </Accordion>
    </Container>
  );
}
